","keccak256":"0x5b9e31b8cea62f7d2206a0b3f7c60d2260cd110acf59803465133f8d7b6ec862","license":"MIT"},"contracts/Staker.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import "hardhat/console.sol";
import "./ExampleExternalContract.sol";

contract Staker {

  ExampleExternalContract public exampleExternalContract;

  constructor(address exampleExternalContractAddress) {
      exampleExternalContract = ExampleExternalContract(exampleExternalContractAddress);
      deadline= block.timestamp + 72 hours;
  }

  // Collect funds in a payable `stake()` function and track individual `balances` with a mapping:
  // ( Make sure to add a `Stake(address,uint256)` event and emit it for the frontend <List/> display )
    
    event Stake(address,uint256);
    
    mapping ( address => uint256 ) public balances;
    
    uint256 public constant threshold = 1 ether;
     
     function stake()public payable{
       require(block.timestamp < deadline, "Not Yet") ;
        require(!executed, "Already Exe") ;
        balances[msg.sender] += msg.value;
        emit Stake(msg.sender,msg.value);

     }


  // After some `deadline` allow anyone to call an `execute()` function
  // If the deadline has passed and the threshold is met, it should call `exampleExternalContract.complete{value: address(this).balance}()`
      uint256 public deadline;
     
      bool public openForWithdraw ;
      bool public executed ;
      function execute()public {
        
        require(block.timestamp >deadline, "Not Yet") ;
        require(!executed, "Already Exe") ;
        executed = true;
        if( address(this).balance >= threshold){

          exampleExternalContract.complete{value: address(this).balance}();
        }else{

                openForWithdraw = true ; 

        }
       
  
      }

  // If the `threshold` was not met, allow everyone to call a `withdraw()` function


  // Add a `withdraw()` function to let users withdraw their balance
      function withdraw() public{
         require(openForWithdraw,"Not Ready Withdraw");
         require(balances[msg.sender]>0,"No Balance");
         uint256 amount = balances[msg.sender];
         balances[msg.sender]=0;
         (bool sent,) = msg.sender.call{value: amount}("");
         require(sent, "failed to send Eth");

      }

  // Add a `timeLeft()` view function that returns the time left before the deadline for the frontend
    function timeLeft() public view returns(uint256){

 if(block.timestamp >=deadline){
      return 0 ;
    }else{
      return deadline - block.timestamp;
    }



 }
   


   

  // Add the `receive()` special function that receives eth and calls stake()
  receive() external payable{
    stake();
  }

}
